import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const API_CONFIG = {
  BASE_URL: 'http://127.0.0.1:8000',
  ENDPOINTS: {
    BRANDS: '/brands',
    MODELS: '/models',
    PREDICT: '/predict'
  }
};

const OPTIONS = {
  ORIGINS: ['WW au Maroc', 'Importée neuve', 'Dédouanée', 'Autre', 'Pas encore dédouanée'],
  FUEL_TYPES: ['Diesel', 'Essence', 'Hybride', 'Electrique', 'LPG'],
  OWNERSHIP: ['Oui', 'Non', 'Autre'],
  CONDITIONS: ['Excellent', 'Bon', 'Très bon', 'Neuf', 'Correct', 'Endommagé', 'Pour Pièces'],
  DOORS: ['2', '3', '4', '5'],
  TRANSMISSION: ['manuelle', 'automatique']
};

function CarPricePredictor() {
  const [formData, setFormData] = useState({
    marke: '',
    model: '',
    Année_Modèle: '',
    kilometrage: '',
    Nombre_de_portes: '4',
    Puissance_fiscale: '',
    Première_main: 'Non',
    type_boit: 'manuelle',
    type_carburant: 'Essence',
    État: 'Bon',
    Origine: 'WW au Maroc'
  });

  const [brands, setBrands] = useState([]);
  const [models, setModels] = useState([]);
  const [loading, setLoading] = useState({
    brands: false,
    models: false,
    prediction: false
  });
  const [errors, setErrors] = useState({});
  const [prediction, setPrediction] = useState(null);

  useEffect(() => {
    const loadData = async () => {
      try {
        setLoading(prev => ({ ...prev, brands: true }));
        const brandsRes = await axios.get(`${API_CONFIG.BASE_URL}${API_CONFIG.ENDPOINTS.BRANDS}`);
        setBrands(brandsRes.data.brands || []);
      } catch (error) {
        console.error("Erreur chargement marques:", error);
        setErrors(prev => ({ ...prev, api: "Erreur chargement des marques" }));
      } finally {
        setLoading(prev => ({ ...prev, brands: false }));
      }
    };
    loadData();
  }, []);

  useEffect(() => {
    if (formData.marke) {
      const loadModels = async () => {
        try {
          setLoading(prev => ({ ...prev, models: true }));
          const modelsRes = await axios.get(
            `${API_CONFIG.BASE_URL}${API_CONFIG.ENDPOINTS.MODELS}/${formData.marke}`
          );
          setModels(modelsRes.data.models || []);
        } catch (error) {
          console.error("Erreur chargement modèles:", error);
        } finally {
          setLoading(prev => ({ ...prev, models: false }));
        }
      };
      loadModels();
    } else {
      setModels([]);
    }
  }, [formData.marke]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));

    if (name === 'marke') setFormData(prev => ({ ...prev, model: '' }));
  };

  const validateForm = () => {
    const newErrors = {};
    const currentYear = new Date().getFullYear();

    if (!formData.marke) newErrors.marke = 'Sélectionnez une marque';
    if (!formData.model) newErrors.model = 'Sélectionnez un modèle';
    if (!formData.Année_Modèle || formData.Année_Modèle < 1990 || formData.Année_Modèle > currentYear) {
      newErrors.Année_Modèle = `Année invalide (1990-${currentYear})`;
    }
    if (!formData.kilometrage || formData.kilometrage < 0) newErrors.kilometrage = 'Kilométrage invalide';
    if (!formData.Puissance_fiscale || formData.Puissance_fiscale <= 0) {
      newErrors.Puissance_fiscale = 'Puissance fiscale requise';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!validateForm()) return;

    setLoading(prev => ({ ...prev, prediction: true }));
    setPrediction(null);

    try {
      const response = await axios.post(
        `${API_CONFIG.BASE_URL}${API_CONFIG.ENDPOINTS.PREDICT}`,
        formData,
        {
          headers: {
            'Content-Type': 'application/json'
          }
        }
      );

      setPrediction({
        price: response.data.predicted_price,
        confidence: response.data.confidence
      });
    } catch (error) {
      console.error("Erreur prédiction:", error);
      const errorMsg = error.response?.data?.detail ||
                      error.response?.statusText ||
                      "Erreur lors de la connexion au serveur";
      setErrors(prev => ({ ...prev, api: errorMsg }));
    } finally {
      setLoading(prev => ({ ...prev, prediction: false }));
    }
  };

  return (
   <div className="app-container">
  <header className="app-header">
    <h1>Prédisez le prix de votre voiture</h1>
    <p>Obtenez une estimation fiable en quelques clics</p>
  </header>

  {/* Première ligne avec 3 champs */}
  <div className="form-row-3">
    <div className="form-group">
      <label>Marque</label>
      <select name="marke" value={formData.marke} onChange={handleChange}>
        <option value="">Volkswagen</option>
        {/* autres options */}
      </select>
    </div>

    <div className="form-group">
      <label>Modèle</label>
      <select name="model" value={formData.model} onChange={handleChange}>
        <option value="">Sélectionnez</option>
        {/* autres options */}
      </select>
    </div>

    <div className="form-group">
      <label>Année</label>
      <input
        type="number"
        name="Année_Modèle"
        placeholder="2020"
        value={formData.Année_Modèle}
        onChange={handleChange}
      />
    </div>
  </div>

  {/* Deuxième ligne avec 3 champs */}
  <div className="form-row-3">
    <div className="form-group">
      <label>Kilométrage</label>
      <input
        type="number"
        name="kilometrage"
        placeholder="50 000 km"
        value={formData.kilometrage}
        onChange={handleChange}
      />
    </div>

    <div className="form-group">
      <label>Boîte de vitesses</label>
      <select name="type_boit" value={formData.type_boit} onChange={handleChange}>
        <option value="manuelle">Manuelle</option>
        <option value="automatique">Automatique</option>
      </select>
    </div>

    <div className="form-group">
      <label>Carburant</label>
      <select name="type_carburant" value={formData.type_carburant} onChange={handleChange}>
        <option value="Essence">Essence</option>
        <option value="Diesel">Diesel</option>
        {/* autres options */}
      </select>
    </div>
  </div>

  {/* Troisième ligne avec 3 champs */}
  <div className="form-row-3">
    <div className="form-group">
      <label>Puissance fiscale</label>
      <input
        type="number"
        name="Puissance_fiscale"
        placeholder="5.5 CV"
        value={formData.Puissance_fiscale}
        onChange={handleChange}
      />
    </div>

    <div className="form-group">
      <label>Première main</label>
      <select name="Première_main" value={formData.Première_main} onChange={handleChange}>
        <option value="Oui">Oui</option>
        <option value="Non">Non</option>
      </select>
    </div>

    <div className="form-group">
      <label>État</label>
      <select name="État" value={formData.État} onChange={handleChange}>
        <option value="Bon">Bon</option>
        <option value="Très bon">Très bon</option>
        {/* autres options */}
      </select>
    </div>
  </div>

  <button className="submit-btn">Estimer le prix</button>
</div>
  );
}

export default CarPricePredictor;
